class Todo{
  constructor(title, description, dueDate, priority){
    this.title = title;
    this.description = description;
    if (typeof dueDate == 'string'){
      if (dueDate.length > 10){
        dueDate = new Date(dueDate);
      }
      else{
        let [year, month, day] = dueDate.split('-');
        month--;
        dueDate = new Date(year, month, day);
        console.log(dueDate);
      }
      

    }
    this.dueDate = dueDate;
    this.priority = priority;
    this.done = false;
  }

  edit(title, description, dueDate, priority){
    if (title) this.title = title;
    if (description) this.description = description;
    if (dueDate) {
      let [year, month, day] = dueDate.split('-');
      month--;
      dueDate = new Date(year, month, day);
      this.dueDate = dueDate;
    }
    if (priority) this.priority = priority;
  }

  do(){
    this.done = !this.done;
  }
}

class Project{
  constructor(name, store={}, nextIndex=0){
    this.name = name;
    this.store = store;
    this.nextIndex = nextIndex;
    for (const key in store){
      let todoData = store[key];
      store[key] = new Todo(todoData.title, todoData.description, todoData.dueDate, todoData.priority);
    }
  }

  addTodo(title, description, dueDate, priority){
    const todo = new Todo(title, description, dueDate, priority);
    this.store[this.nextIndex] = todo
    this.nextIndex++;
    return [this.nextIndex - 1, todo]
  }

  removeTodo(id){
    delete this.store[id];
  }

  editTodo(id, title, description, dueDate, priority){
    if (id in this.store){
      this.store[id].edit(title, description, dueDate, priority)
      return true;
    }
    return false;
  }

  doneTodo(id){
    if (id in this.store){
      this.store[id].do();
      return true;
    }
    return false;
  }
}

